

DROP TABLE IF EXISTS `goods`;

CREATE TABLE `goods` (
  `id` char(19) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '商品ID',
  `title` varchar(255) COLLATE utf8mb4_general_ci NOT NULL COMMENT '商品名称',
  `description` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '商品描述表',
  `price` bigint NOT NULL COMMENT '商品价格(分)',
  `image` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '商品图片',
  `spec` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '商品规格',
  `detail` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '商品详情',
  `category_id` char(19) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '分类id',
  `gmt_create` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '商品创建时间',
  PRIMARY KEY (`id`) COMMENT '主键',
  FULLTEXT KEY `title` (`title`) COMMENT '全文索引' /*!50100 WITH PARSER `ngram` */ 
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

